import React from "react";
import styles from "./styles.module.css";
import jsonData from "./components/productData.json"

function App() {
  return (
    <div className={styles.main}>
      <input type="text" />
      {jsonData.map((value, key) =>{
        return <div> <div>{value.ProductName}
          </div></div>;
      })}
    </div>
  );
}

export default App;
